import React, { Component } from 'react'
import Nav from "../components/nav";
import Card from "../components/card";


export class index extends Component {
    constructor(props){
        super(props)
        this.state={
            items:null
        }
        this.renderData = this.renderData.bind(this)


    }
    render() {
        return (
            <div>
                <Nav />
                <Card />

            </div>
        )
    }
}

export default index
